A mysterious force from a parallel universe wreaks havoc on a small town as a scientist fights to stop it from taking over the world!
 In Deadly Voltage, you'll find yourself in an abandoned city with only your wits to guide you and a bizarre invention clamped around your wrist to protect you from the surges of electrical power that crackle in the air. As you follow the prodding of an eccentric scientist, who's hiding in his laboratory across town, you'll make your way through empty streets, an abandoned toy factory and more, searching for clues and solving puzzles that take you one step closer to a &quot;shocking&quot; revelation.

